import React from "react";
import Model from "../models/Model.js";
export default class List extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="List">
                 <div className="col-lg-4" key={model._id}>
                    {this.props.list.map(model => {
                        return(
                           
                                <Model model = {model}/>
                            
                        ) 
                    })}
                 </div>
            </div>
        )
    }
}
